    public function __construct() {

    }

    public function getData($unit_id = null, $jabatan_id = null, $level_id = null, $pangkat_id = [], $pensiun = false) {

        $time_now = Carbon::now();
        $now = $time_now->toDateTimeString();
        $three_years_after = date('Y-m-d',strtotime('-3 years'));

        $query = DB::table('karyawans')
            ->select('karyawans.*',
                'units.kode AS kode_unit',
                'units.nama AS nama_unit',
                'jabatans.nama AS nama_jabatan',
                'levels.nama AS nama_level',
                'pangkats.nama AS nama_pangkat',
                'penilaian_karyawan.id AS penilaian_karyawan_id',
                'penilaian_karyawan.status_promosi AS penilaian_karyawan_status_promosi'

            )
            ->where('karyawans.deleted_at', null)
            // ->whereIn('penilaian_karyawan.status_promosi', [null, true])
            ->leftjoin('units', 'karyawans.unit_kerja_id', '=', 'units.id')
            ->leftjoin('jabatans', 'karyawans.jabatan_id', '=', 'jabatans.id')
            ->leftjoin('levels', 'karyawans.level_id', '=', 'levels.id')
            ->leftjoin('pangkats', 'karyawans.pangkat_id', '=', 'pangkats.id')
            ->leftjoin('penilaian_karyawan', 'karyawans.id', '=', 'penilaian_karyawan.id_karyawan')
            // ->groupBy('karyawans.id', 'units.kode', 'units.nama', 'jabatans.nama', 'levels.nama', 'pangkats.nama', 'penilaian_karyawan.id', 'penilaian_karyawan.status_promosi')
            ;

        if($unit_id != null)
            $query->where('karyawans.unit_kerja_id', $unit_id);

        if($jabatan_id != null)
            $query->where('karyawans.jabatan_id', $jabatan_id);

        if($level_id != null)
            $query->where('karyawans.level_id', $level_id);

        if(!empty($pangkat_id))
            $query->whereIn('pangkats.grade', $pangkat_id);

        if($pensiun == true) {
            $query->where('karyawans.tanggal_pensiun', '>', $now);
            // $query->where('karyawans.tmt_jabatan', '<', $three_years_after);
        }

        return $query;
    }

    public function getJabatan($unit_id) {
        $query = DB::table('jabatans')
            ->select('jabatans.id', 'jabatans.kode', 'jabatans.nama')
            ->where('jabatan_relations.unit_id', $unit_id)
            ->leftjoin('jabatan_relations', 'jabatans.id', '=', 'jabatan_relations.jabatan_id')
            ->groupBy('jabatans.id', 'jabatans.kode', 'jabatans.nama');

        return $query;
    }

    public function getPangkat($params) {
        $query = DB::table('pangkats')
            ->select('pangkats.id', 'pangkats.kode', 'pangkats.nama', 'pangkats.grade')
            ->where('jabatan_relations.unit_id', $params->unit_kerja_id)
            ->where('jabatan_relations.jabatan_id', $params->jabatan_id)
            ->leftjoin('jabatan_relations', 'pangkats.id', '=', 'jabatan_relations.pangkat_id')
            ->groupBy('pangkats.id', 'pangkats.kode', 'pangkats.nama', 'pangkats.grade');

        return $query;
    }

    public function getLevel($params) {

        $query = DB::table('levels')
            ->select('levels.id', 'levels.nama')
            ->leftjoin('jabatan_relations', 'levels.id', '=', 'jabatan_relations.level_id')
            ->groupBy('levels.id', 'levels.nama');

        if(isset($params->unit_kerja_id))
            $query->where('jabatan_relations.unit_id', $params->unit_kerja_id);

        if(isset($params->jabatan_id))
            $query->where('jabatan_relations.jabatan_id', $params->jabatan_id);

        if(isset($params->pangkat_id))
            $query->where('jabatan_relations.pangkat_id', $params->pangkat_id);

        return $query;
    }

